import { Tab, Tabs, Typography } from "@mui/material";
import axios from "axios";
import { useEffect, useState } from "react";

export default function TabFilterComponent() {
  const genreApi = "https://qtify-backend-labs.crio.do/genres";

  const [data, setData] = useState();

  let fetchData = async () => {
    try {
      let response = await axios.get(genreApi);
      console.log(response.data.data);
      setData(response.data.data);
    } catch (err) {
      console.error("error while fetching top albums", err);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  const [value, setValue] = useState(0);
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <div>
      <Typography style={{ color: "#121212" }}>Songs</Typography>

      <ul class="nav nav-underline">
        {data
          ? data.map((e) => (
              <li class="nav-item">
                <Typography
                  className="nav-link "
                  aria-current="page"
                  href="#"
                >
                  {e.key}
                </Typography>
              </li>
            ))
          : "loading..."}
      </ul>
    </div>
  );
}
